import gopaljilab.dsa.string.ValidAnagram;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

public class ValidAnagramTest {

    @Test
    void TestBaseCase(){
        String string1 = "anagram";
        String string2 = "nagaram";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = true;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "Anagram of anagram should be with the all letters");
    }

    @Test
    void TestNotValidAnagram(){
        String string1 = "rat";
        String string2 = "car";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = false;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "rat of anagram should be with the all letters");
    }

    @Test
    void TestNullString(){
        String string1 = "";
        String string2 = "";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = true;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "'' of anagram should be with the all letters");
    }

    @Test
    void TestSensitivityCase(){
        String string1 = "Anagram";
        String string2 = "nagaram";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = false;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "'Anagram' of anagram should be comes with all the letters");
    }

    @Test
    void TestRepeatedCharacterCase(){
        String string1 = "aabbcc";
        String string2 = "abcabc";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = true;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "'Anagram' of anagram should be comes with all the letters");
    }

    @Test
    void TestSpecialCharacterCase(){
        String string1 = "hello!";
        String string2 = "!olleh";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = true;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "'Anagram' of anagram should be comes with all the letters");
    }

    @Test
    void TestLongStringCase(){
        String string1 = "" +
                "\"";
        String string2 = "" +
                "\"";
        ValidAnagram validAnagram = new ValidAnagram();
        boolean expected = true;
        boolean actual = validAnagram.isAnagram(string1, string2);
        assertEquals(expected, actual,
                "'Anagram' of anagram should be comes with all the letters");
    }
}
